import React, { useEffect, useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import {
  Container,
  Paper,
  Typography,
  Button,
  Box,
  Grid,
  Card,
  CardContent,
  LinearProgress,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Chip
} from '@mui/material';
import { CheckCircle, Home, Assessment } from '@mui/icons-material';

const ResultsPage = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const [results, setResults] = useState(null);
  const [testId, setTestId] = useState('');

  useEffect(() => {
    if (location.state?.results) {
      const resultsData = location.state.results;
      // Ensure score is a number
      if (resultsData.score !== undefined) {
        resultsData.score = parseFloat(resultsData.score) || 0;
      }
      setResults(resultsData);
      setTestId(location.state.testId || '');
    } else {
      // If no results in state, redirect to home
      navigate('/');
    }
  }, [location, navigate]);

  if (!results) {
    return (
      <Container maxWidth="md" sx={{ mt: 4 }}>
        <LinearProgress />
        <Typography sx={{ mt: 2 }}>Loading results...</Typography>
      </Container>
    );
  }

  // Safely get the score as a number
  const score = typeof results.score === 'number' ? results.score : parseFloat(results.score) || 0;
  const totalQuestions = results.totalQuestions || 0;
  const correctAnswers = results.correctAnswers || 0;
  const duration = results.duration || 0;
  const categoryScores = results.categoryScores || {};

  const getScoreColor = (scoreValue) => {
    if (scoreValue >= 80) return 'success';
    if (scoreValue >= 60) return 'warning';
    return 'error';
  };

  const getPerformanceText = (scoreValue) => {
    if (scoreValue >= 80) return 'Excellent';
    if (scoreValue >= 70) return 'Good';
    if (scoreValue >= 60) return 'Average';
    if (scoreValue >= 50) return 'Below Average';
    return 'Needs Improvement';
  };

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Paper elevation={3} sx={{ p: 4 }}>
        <Box sx={{ textAlign: 'center', mb: 4 }}>
          <Assessment sx={{ fontSize: 60, color: getScoreColor(score), mb: 2 }} />

          <Typography variant="h3" gutterBottom>
            Test Results
          </Typography>

          <Typography variant="h6" gutterBottom color="text.secondary">
            Cybersecurity Aptitude Assessment
          </Typography>
        </Box>

        {/* Overall Score */}
        <Card sx={{ mb: 4 }}>
          <CardContent>
            <Grid container spacing={3} alignItems="center">
              <Grid item xs={12} md={4}>
                <Box sx={{ textAlign: 'center' }}>
                  <Typography variant="h2" color={getScoreColor(score)}>
                    {score.toFixed(1)}%
                  </Typography>
                  <Typography variant="h6" gutterBottom>
                    Overall Score
                  </Typography>
                  <Chip 
                    label={getPerformanceText(score)} 
                    color={getScoreColor(score)}
                    variant="outlined"
                  />
                </Box>
              </Grid>

              <Grid item xs={12} md={8}>
                <Typography variant="h6" gutterBottom>
                  Test Summary
                </Typography>
                <Grid container spacing={2}>
                  <Grid item xs={6}>
                    <Typography variant="body2" color="text.secondary">
                      Correct Answers
                    </Typography>
                    <Typography variant="h5">
                      {correctAnswers} / {totalQuestions}
                    </Typography>
                  </Grid>
                  <Grid item xs={6}>
                    <Typography variant="body2" color="text.secondary">
                      Duration
                    </Typography>
                    <Typography variant="h5">
                      {Math.floor(duration / 60)}m {duration % 60}s
                    </Typography>
                  </Grid>
                </Grid>

                <Box sx={{ mt: 2 }}>
                  <Typography variant="body2" color="text.secondary" gutterBottom>
                    Overall Progress
                  </Typography>
                  <LinearProgress 
                    variant="determinate" 
                    value={score} 
                    color={getScoreColor(score)}
                    sx={{ height: 10, borderRadius: 5 }}
                  />
                </Box>
              </Grid>
            </Grid>
          </CardContent>
        </Card>

        {/* Category Breakdown */}
        {Object.keys(categoryScores).length > 0 && (
          <Card sx={{ mb: 4 }}>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Performance by Category
              </Typography>

              <TableContainer>
                <Table>
                  <TableHead>
                    <TableRow>
                      <TableCell>Category</TableCell>
                      <TableCell align="right">Correct</TableCell>
                      <TableCell align="right">Total</TableCell>
                      <TableCell align="right">Score</TableCell>
                      <TableCell align="right">Progress</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {Object.entries(categoryScores).map(([category, data]) => {
                      // Safely calculate percentage
                      const correct = data.correct || 0;
                      const total = data.total || 1; // Avoid division by zero
                      const percentage = total > 0 ? (correct / total * 100) : 0;

                      return (
                        <TableRow key={category}>
                          <TableCell>
                            <Typography variant="body2">
                              {category.replace(/_/g, ' ')}
                            </Typography>
                          </TableCell>
                          <TableCell align="right">
                            <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'flex-end' }}>
                              {correct > 0 && <CheckCircle fontSize="small" color="success" sx={{ mr: 1 }} />}
                              {correct}
                            </Box>
                          </TableCell>
                          <TableCell align="right">{total}</TableCell>
                          <TableCell align="right">
                            <Chip 
                              label={`${percentage.toFixed(1)}%`}
                              size="small"
                              color={getScoreColor(percentage)}
                            />
                          </TableCell>
                          <TableCell align="right">
                            <Box sx={{ width: 100, display: 'inline-block' }}>
                              <LinearProgress 
                                variant="determinate" 
                                value={percentage} 
                                color={getScoreColor(percentage)}
                                sx={{ height: 8, borderRadius: 4 }}
                              />
                            </Box>
                          </TableCell>
                        </TableRow>
                      );
                    })}
                  </TableBody>
                </Table>
              </TableContainer>
            </CardContent>
          </Card>
        )}

        {/* Recommendations */}
        <Card sx={{ mb: 4 }}>
          <CardContent>
            <Typography variant="h6" gutterBottom>
              Recommendations
            </Typography>

            <Typography variant="body1" paragraph>
              Based on your performance, here are some recommendations for your cybersecurity training:
            </Typography>

            <Grid container spacing={2}>
              <Grid item xs={12} md={6}>
                <Paper elevation={1} sx={{ p: 2, height: '100%' }}>
                  <Typography variant="subtitle2" gutterBottom color="primary">
                    Focus Areas:
                  </Typography>
                  <Box component="ul" sx={{ mt: 1, pl: 2 }}>
                    {Object.keys(categoryScores).length > 0 ? (
                      Object.entries(categoryScores)
                        .filter(([_, data]) => {
                          const correct = data.correct || 0;
                          const total = data.total || 1;
                          return total > 0 && (correct / total) < 0.7;
                        })
                        .map(([category, _]) => (
                          <Typography component="li" variant="body2" key={category}>
                            {category.replace(/_/g, ' ')}
                          </Typography>
                        ))
                    ) : (
                      <Typography component="li" variant="body2">
                        Basic cybersecurity concepts
                      </Typography>
                    )}
                  </Box>
                </Paper>
              </Grid>

              <Grid item xs={12} md={6}>
                <Paper elevation={1} sx={{ p: 2, height: '100%' }}>
                  <Typography variant="subtitle2" gutterBottom color="primary">
                    Next Steps:
                  </Typography>
                  <Box component="ul" sx={{ mt: 1, pl: 2 }}>
                    <Typography component="li" variant="body2">Review basic cybersecurity concepts</Typography>
                    <Typography component="li" variant="body2">Practice with hands-on labs</Typography>
                    <Typography component="li" variant="body2">Join the UR AFRETEC-MASTERCARD training sessions</Typography>
                    <Typography component="li" variant="body2">Explore online cybersecurity resources</Typography>
                  </Box>
                </Paper>
              </Grid>
            </Grid>
          </CardContent>
        </Card>

        {/* Actions */}
        <Box sx={{ display: 'flex', justifyContent: 'center', gap: 2, mt: 4 }}>
          <Button
            variant="contained"
            startIcon={<Home />}
            onClick={() => navigate('/')}
          >
            Return to Home
          </Button>

          {testId && (
            <Button
              variant="outlined"
              onClick={() => {
                // Implement download functionality here
                alert('Download feature coming soon!');
              }}
            >
              Download Results (PDF)
            </Button>
          )}
        </Box>

        <Typography variant="body2" sx={{ mt: 4, textAlign: 'center', color: 'text.secondary' }}>
          Thank you for completing the Cybersecurity Aptitude Test. 
          Your results will help tailor the UR AFRETEC-MASTERCARD training program to your needs.
        </Typography>
      </Paper>
    </Container>
  );
};

export default ResultsPage;
